import React from 'react'

const MultiView = () => {
    return(
        <div className="multiview_style">
            <div>1</div>
            <div>2</div>
            <div>3</div>
            <div>4</div>
            <div>5</div>
            <div>6</div>
        </div>
    );
}

export default MultiView
